import logo from "./logo.svg";
import "./App.css";
import React, { useState, useEffect } from "react";
import Home from "./components/home.js";

function App() {
  const [usuarios, setUsuarios] = useState([]);
  useEffect(() => {
    fetch("/usuarios")
      .then((data) => data.json())
      .then((data) => {
        setUsuarios(data);
      });
  });
  return (
    <Router>
      <Switch>
      <Route path="/">
            <Home />
          </Route>
      </Switch>
    </Router>
  );
}

export default App;
